import React, {useState} from 'react';
import "../styles/TableManager.scss";
import MySelect from "./UI/MySelect";
import MyInput from "./UI/MyInput";

const TableManager = () => {
    const FILTER_FIELDS = {
        date: "Дата",
        title: "Название",
        quantity: "Количество",
        distance: "Растояние"
    };
    const FILTER_CONDITIONS = {
        equal: "Равно",
        contains: "Содержит",
        more: "Больше",
        less: "Меньше"
    };
    const [filterField, setFilterField] = useState<string>(Object.keys(FILTER_FIELDS)[0]);
    const [filterCondition, setFilterCondition] = useState<string>(Object.keys(FILTER_CONDITIONS)[0]);
    const [filterValue, setFilterValue] = useState<string>();

    return (
        <div className="TableManager">
            <MySelect
                data={FILTER_FIELDS}
                value={filterField}
                onChange={(event: any) => setFilterField(event.target.value)}
                title="Поле"
            />
            <MySelect
                data={FILTER_CONDITIONS}
                value={filterCondition}
                onChange={(event: any) => setFilterCondition(event.target.value)}
                title="Условие"
            />
            <MyInput title="Значение"/>
        </div>
    );
};

export default TableManager;
